import React from 'react';
import Slider from 'react-slick';

import example1 from '../assets/example1.jpg';
import example2 from '../assets/example2.jpg';

function Work() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000
  };

  return (
    <div className='h-screen bg-red-400'>
      <Slider {...settings}>
        <div>
          <img className='h-36 mx-2 my-2' src={example1} alt="Example of work 1" />
        </div>
        <div>
          <img className='h-36 mx-2 my-2' src={example2} alt="Example of work 2" />
        </div>
      </Slider>
    </div>
  );
}

export default Work;
